import React from 'react';
import styles from "./Edu.module.css";
import { makeStyles } from '@material-ui/core/styles';
import { Typography, Grid, Box} from '@material-ui/core';
import utsa from './utsa.png';
import cx from 'classnames';


function Edu() {

    return (
        <div>
            <Grid>
                <Box boxShadow={1} className={styles.header} textAlign="center" fontWeight="bold" display="flex">
                        <Typography variant="h5" className={styles.text}>Education</Typography> 
                        <img src={utsa} alt="profile" className={styles.img}/>
                    </Box>
            </Grid>
        </div>
    );
}

export default Edu;
